appcast.connect = function() {
  var messages_socket, vu_socket;
  if (!app.settings.use_appcast) {
    return;
  }
  if (appcast.get('connected')) {
    console.error('Appcast already connected');
    return;
  }
  if (!WebSocket) {
    return console.info('+ socket controller wont connect');
  }
  messages_socket = 'ws://127.0.0.1:51234/loopcast/messages';
  appcast.messages = new v.ReconnectingWebsocket(messages_socket);
  appcast.messages.onopen = function() {
    console.info('- socket controller connection opened');
    appcast.set('connected', true);
    if (appcast.get('selected_device')) {
      appcast.select_device(appcast.get('selected_device'));
    }
    appcast.get_devices();
    return appcast.messages.send(JSON.stringify(['version']));
  };
  appcast.messages.onclose = function() {
    console.info('- AppCast CLOSED');
    return delay(100, function() {
      appcast.set('stream:vu', [0, 0]);
      return appcast.set('connected', false);
    });
  };
  appcast.messages.onmessage = function(e) {
    var args, error, from_json, json, method;
    json = e.data;
    try {
      from_json = JSON.parse(json);
    } catch (_error) {
      error = _error;
      console.error("- socket controller error parsing json");
      console.error(error);
      return error;
    }
    method = from_json[0];
    args = from_json[1];
    if ('error' === method) {
      return console.log('error', args);
    }
    if (typeof appcast.callbacks[method] === 'function') {
      return appcast.callbacks[method](args);
    } else {
      return console.log(" + socket controller has no callback for:", method);
    }
  };
  vu_socket = 'ws://127.0.0.1:51234/loopcast/vu';
  appcast.vu = new v.ReconnectingWebsocket(vu_socket);
  appcast.vu.onopen = function() {
    console.info('- socket VU connection opened');
    return appcast.set('vu:connected', true);
  };
  appcast.vu.onclose = function() {
    console.info('- socket VU connection closed');
    appcast.set('vu:connected', false);
    return appcast.set('stream:vu', 0);
  };
  return appcast.vu.onmessage = function(e) {
    var reader;
    reader = new FileReader;
    reader.onload = function(e) {
      var buffer;
      buffer = new Float32Array(e.target.result);
      if (!appcast.get('connected')) {
        return;
      }
      return appcast.set('stream:vu', buffer);
    };
    return reader.readAsArrayBuffer(e.data);
  };
};

appcast.disconnect = function() {
  appcast.messages.close();
  return appcast.vu.close();
};

appcast.get_devices = function() {
  return appcast.messages.send(JSON.stringify(['get_input_devices']));
};

appcast.start_stream = function(username, room_slug, password, device_name) {
  var payload;
  if (appcast.get("stream:starting")) {
    return console.error("waiting stream to start, cant start again");
  }
  if (appcast.get("stream:online")) {
    return console.error("stream is already online, cant start again");
  }
  if (window.is_beta != null) {
    password = "beta-radio-client";
    payload = {
      device_name: device_name,
      mount_point: mount_point,
      password: password,
      port: "8000",
      server: 'radio.loopcast.fm'
    };
  } else {
    payload = {
      device_name: device_name,
      mount_point: "loopcast-staging/" + username + "_" + room_slug,
      password: password,
      port: "80",
      server: 'inbound-a.cdn.audiopump.co'
    };
  }
  console.log('stream with payload ->', payload);
  appcast.set("stream:starting", true);
  return appcast.messages.send(JSON.stringify(["start_stream", payload]));
};

appcast.start_recording = function() {
  return appcast.set("stream:recording", true);
};

appcast.stop_recording = function() {
  return appcast.set("stream:recording", false);
};

appcast.select_device = function(device_name) {
  var payload;
  appcast.set('selected_device', device_name);
  appcast.set('stream:vu', 0);
  payload = {
    device_name: device_name
  };
  return appcast.messages.send(JSON.stringify(["start_audio_device", payload]));
};

appcast.stop_stream = function() {
  appcast.set("stream:streaming", false);
  appcast.set('stream:starting', false);
  appcast.set("stream:stopping", true);
  appcast.set('stream:vu', 0);
  return appcast.messages.send(JSON.stringify(["stop_stream"]));
};

appcast.get_version = function() {
  return appcast.messages.send(JSON.stringify(["version"]));
};

/*
# callbacks are called by "messages" coming from the WebsocketServer created
# by the desktop application AppCast
*/


appcast.callbacks = {
  input_devices: function(args) {
    appcast.set('input_devices', args.devices);
    if (args.active) {
      return appcast.set('selected_device', args.active);
    }
  },
  audio_device_started: function(args) {
    if ((args != null) && (args.error != null)) {
      console.error("- audio_device_started error:", args.error);
    }
  },
  stream_started: function(args) {
    if ((args != null) && (args.error != null)) {
      console.error("- stream_started error:", args.error);
      appcast.set("stream:error", args.error);
      return;
    }
    console.info("APPCAST REPLIED: STREAM STARTED!");
    appcast.set('stream:online', true);
    appcast.set("stream:starting", null);
    return appcast.set("stream:error", null);
  },
  stream_stopped: function() {
    appcast.set('stream:online', false);
    appcast.set("stream:stopping", null);
    return appcast.set('stream:vu', 0);
  },
  version_response: function(data) {
    data.build = Number(data.build);
    appcast.set("build", data.build);
    return L.user.appcast_version(data, function(error, callback) {
      if (error) {
        return console.error(error);
      }
    });
  }
};

module.exports = window.appcast = appcast;

